export default function TaskList({ tasks }) {
  return (
    <div>
      <h3>Task List</h3>
      <ul>
        {tasks.map((t) => (
          <li key={t.id}>
            #{t.id} – {t.title} (User {t.user_id}) {t.done ? "✅" : "❌"}
          </li>
        ))}
      </ul>
    </div>
  );
}
